/*------------------------Vistas---------------------------------*/
--------------------------------------------------------------------
---------------------------------------------------------------------
 /*Vista para ver las personas que son pasajeros y empleados*/
CREATE VIEW VW_EMPLEADOPASAJERO(PrimerNombre,PrimerApellido,Pais,Correo)AS
SELECT P.PNOMBRE,P.PAPELLIDO,PS.NOMBREPAIS,P.CORREO
FROM PERSONA P
INNER JOIN EMPLEADO E ON P.IDPERSONA=E.PERSONA_IDPERSONA
INNER JOIN PASAJERO PJ ON P.IDPERSONA=PJ.PERSONA_IDPERSONA
INNER JOIN PAIS PS ON P.PAIS_IDPAIS=PS.IDPAIS;


/*Vista para ver la informacion de los empleados, cargo, jefe, sueldobase...*/
CREATE VIEW VW_INFOEMPLEADO (PRIMERNOMBRE,PRIMERAPELLIDO,PAIS,CORREO,CARGO,SUELDOBASE) AS
SELECT P.PNOMBRE,P.PAPELLIDO,PS.NOMBREPAIS,P.CORREO,CG.NOMBRECARGO,CG.SUELDOBASE
FROM PERSONA P
INNER JOIN EMPLEADO E ON P.IDPERSONA=E.PERSONA_IDPERSONA
INNER JOIN PAIS PS ON P.PAIS_IDPAIS=PS.IDPAIS
INNER JOIN EMPLEADOXCARGO EC ON E.IDEMPLEADO=EC.EMPLEADO_IDEMPLEADO
INNER JOIN CARGO CG ON EC.CARGO_IDCARGO=CG.IDCARGO
INNER JOIN EMPLEADOXJEFE EJ ON E.IDEMPLEADO=EJ.EMPLEADO_IDEMPLEADO;


/*Vista informacion de los tripulantes, cargo, sueldo, etc*/
CREATE VIEW VW_INFOTRIPULANTE (PRIMERNOMBRE,PRIMERAPELLIDO,PAIS,CORREO,CARGO,SUELDOBASE) AS
SELECT P.PNOMBRE,P.PAPELLIDO,PS.NOMBREPAIS,P.CORREO,CG.NOMBRECARGO,CG.SUELDOBASE
FROM PERSONA P
INNER JOIN EMPLEADO E ON P.IDPERSONA=E.PERSONA_IDPERSONA
INNER JOIN PAIS PS ON P.PAIS_IDPAIS=PS.IDPAIS
INNER JOIN TRIPULANTE T ON E.IDEMPLEADO=T.EMPLEADO_IDEMPLEADO
  INNER JOIN EMPLEADOXCARGO EC ON E.IDEMPLEADO=EC.EMPLEADO_IDEMPLEADO
INNER JOIN CARGO CG ON EC.CARGO_IDCARGO=CG.IDCARGO
INNER JOIN EMPLEADOXJEFE EJ ON E.IDEMPLEADO=EJ.EMPLEADO_IDEMPLEADO;



/*Vista informacion de los pasajero y la cantidad de vuelos realizados*/
CREATE VIEW VW_INFOPASAJERO (PRIMERNOMBRE,PRIMERAPELLIDO,PAIS,PASAPORTE,CANTIDADVUELOSREALIZADOS) AS
SELECT P.PNOMBRE,P.PAPELLIDO,PS.NOMBREPAIS,PJ.NUMEROPASAPORTE,COUNT(FD.PASAJERO_IDPASAJERO) CANTIDADVUELOS
FROM PERSONA P
INNER JOIN PASAJERO PJ ON P.IDPERSONA=P.IDPERSONA
INNER JOIN PAIS PS ON P.PAIS_IDPAIS=PS.IDPAIS
INNER JOIN FACTURADETALLE FD ON PJ.IDPASAJERO=FD.PASAJERO_IDPASAJERO
GROUP BY P.PNOMBRE,P.PAPELLIDO,PS.NOMBREPAIS,PS.NOMBREPAIS,PJ.NUMEROPASAPORTE;


/*Vista informacion de los aviones*/
CREATE VIEW VW_INFOAVION(REGISTRO,CANTIDADASIENTOS,MARCA,MODELO,PESOEQUIPAJEMAXIMO)AS
SELECT AV.REGISTRO,AV.CANTIDADASIENTOS,M.NOMBREMARCA,MD.NOMBREMODELO,AV.PESOMAXIMOEQUIPAJE
FROM AVION AV
INNER JOIN MARCA M ON AV.MARCA_IDMACA=M.IDMACA
INNER JOIN MODELO MD ON AV.MODELO_IDMODELO=MD.IDMODELO;



/*Vista informacion de los vuelos*/
CREATE VIEW VW_INFOVUELOS(FECHAHORAPARTIDA,FECHAHORALLEGADA,MARCAAVION,MODELOAVION,RUTA,TIEMPOPROMEDIO,CANTIDADPASAJEROS) AS
SELECT VL.FECHAHORAPARTIDA,VL.FECHAHORALLEGADA,M.NOMBREMARCA,MD.NOMBREMODELO,R.ALIASRUTA,R.TIEMPOPROMEDIO,COUNT(FD.PASAJERO_IDPASAJERO) CANTIDADPASAJEROS
FROM VUELO VL
INNER JOIN AVION AV ON VL.AVION_IDAVION=AV.IDAVION
INNER JOIN MARCA M ON AV.MARCA_IDMACA=M.IDMACA
INNER JOIN MODELO MD ON AV.MODELO_IDMODELO=MD.IDMODELO
INNER JOIN RUTA R ON VL.RUTA_IDRUTA=R.IDRUTA
INNER JOIN FACTURADETALLE FD ON VL.IDVUELO=FD.VUELO_IDVUELO
GROUP BY VL.FECHAHORAPARTIDA,VL.FECHAHORALLEGADA,M.NOMBREMARCA,MD.NOMBREMODELO,R.ALIASRUTA,R.TIEMPOPROMEDIO;